import { StyleSheet } from "aphrodite";
const styles = StyleSheet.create({
    partners_mobile_wrapper:{
        padding: '20px',
        backgroundColor: "black",
        display: 'flex',
        flexWrap: 'wrap',
        flexDirection: 'column',
        alignItems: 'center'
    },
    link:{
        height: '50px',
        width: '100px'
    },
    partners_row_text:{
        color: "#acacac",
        marginBottom: '20px',
        textAlign: 'left',
        width: '90%',
        fontFamily: "SFUIDisplay-Regular"
    }
});
export default styles;
